Caption:
Hello everyone! Idk how many “ IM BACK!” posts I’ll have LOL but at least I’m here and alive! I’m so glad I made the decision myself to also create Christian art! 
It’s not everyone’s favorite subject but It’s okay :D

Here is my repost, this is my 1st Christian post and post back from hiatus, this was made an entry to @roobix.art’s music collab! 🎶 

The collab instructed us to create a piece based on a song, lyric or music video. The song I chose was “Refiner” by Maverick City Music & Chandler Moore (feat. Steffany Gretzinger). Which is playing on this post 🤭 It’s really a beautiful song that I hope some of you may check out!  If you do check it out, don’t be scared, the chorus just gets repeated like 70 times 😭🤣 I hope you all liked this piece. And even if you aren’t religious, maybe this piece still can still resonate with you in some way 🫶🏾

If you enjoy this piece do like and share with others.
Follow me for more to come 💜💜
Also always remember, if I post an artwork, 9/10 there will be a Reel to follow up, so be on a lookout 👀 

🎤 Music goers who participated:
@roobix.art (Host): “Run” by Maisie Peters 🎤 @princessmangostea: “Good days” by SZA 🎤
@jemibuni : “Queen of Kings” by Alessandra 🎤@sri._.illustrator: Folksong 🎤
@pink_mink.png: “when you sleep” by my bloody valentine 🎤
@jogofadraws : “Infinity Edge” by pentakill 🎤milkhOney_: “cupid” by fifty fifty 🎤
@pipsqueak_x.x: “bad girls” by M.I.A 🎤
@idk_pistache : “black swan” by BTS 🎤
@shmol_cris: “the death of peace of mind” by bad omens 🎤
@toaster_spider: “last of me” by Circus 🎤
@1zebel_032 : “burning pile” by mother mother 🎤
@denite_comics: "odd eye" by dreamcatcher 🎤@eylon_rn: "everything I wanted" by Billie Eilish
galaxycomicss: "Household Honey" by Iceage Sugar 🎤
@mimijourneyday : " Ice cream" by Blackpink 🎤

Thank you all! I loved being apart of this collab and would love to join more in the future with y'all sometime! 🫶🏾💜

